import React from 'react';
import './Card.css';


function Card (){

return(

<div className="card">
  <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/5/55/Bufotes_balearicus_female.jpg/800px-Bufotes_balearicus_female.jpg" sizes='50px' class="card-img-top" alt="imagem linda"></img>
  <div className="card-body">
    <h5 className="card-title">Card title</h5>
    <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
    <a href="www.sapo.pt" className="btn btn-primary">Go somewhere</a>
  </div>
</div>)



}
export default Card;
